// src/components/h1vertical/H1vertical.js
import React from 'react'
import './H1Vertical.css'

export const H1VerticalLeft = () => {
  return (
    <div className="vertical-container left">
      <h1 className="h1vertical text-white text-5xl font-bold">Note Taker</h1>
    </div>
  )
}

export const H1VerticalRight = () => {
  return (
    <div className="vertical-container right">
      <h1 className="h1vertical text-white text-5xl font-bold">Note Taker</h1>
    </div>
  )
}
